style.css:
@-moz-document domain(roblox.com)
{
	@keyframes slide
  {
    0% {background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  14%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  28%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  42%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  56%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  80%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  94%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }

  100%
  {
    background-color: #fb9bb9;
    border-color: #fb9bb9;
  }
}

.btn-common-play-game-lg
{
  animation: slide 10s infinite;
}
  button.shopping-cart-buy-button.btn-growth-lg.PurchaseButton
  {
    animation: slide 10s infinite;
  }
  a.btn-growth-md.buy-robux.ng-binding.ng-scope
  {
    animation: slide 10s infinite;
  }
  span.cart-number-container
  {
    animation: slide 10s infinite;
  }
  button.action-button.batch-buy-purchase-button.btn-growth-lg.btn-min-width
  {
    animation: slide 10s infinite;
  }
  div.alert.alert-success
  {
    animation: slide 10s infinite;
  }
  button.profile-join-game.btn-growth-md
  {
    animation: slide 10s infinite;
  }
  button.btn-full-width.place-btn.btn-growth-sm
  {
    animation: slide 10s infinite;
  }
}
